/**
 * Step Group: Storing Purchase Price and Appraised Value and comparing which is lowest
 * ID: 2210
 * Steps: 14
 */
export async function stepGroup_Storing_Purchase_Price_and_Appraised_Value_and_comparing_whi(page: import('@playwright/test').Page, vars: Record<string, string>) {
  vars["PurchasePrice"] = await page.locator("//input[@placeholder=\"Purchase Price\"]").inputValue() || '';
  vars["AppraisedValue"] = await page.locator("//input[@placeholder=\"Appraised Value\"]").inputValue() || '';
  if (String(vars["PurchasePrice"]) === String(vars["AppraisedValue"])) {
    vars["TotalLoanAmount"] = (parseFloat(String(vars["LoanAmount"])) + parseFloat(String(vars["SecondLoanAmount"]))).toFixed(0);
    vars["NewCLTVValue"] = (parseFloat(String(vars["TotalLoanAmount"])) / parseFloat(String(vars["PurchasePrice"]))).toFixed(5);
    vars["NewCLTVValue(Expected)"] = (parseFloat(String(vars["NewCLTVValue"])) * parseFloat(String("100"))).toFixed(3);
  } else if (String(vars["PurchasePrice"]) === String(vars["AppraisedValue"])) {
    vars["TotalLoanAmount"] = (parseFloat(String(vars["LoanAmount"])) + parseFloat(String(vars["SecondLoanAmount"]))).toFixed(0);
    vars["NewCLTVValue"] = (parseFloat(String(vars["TotalLoanAmount"])) / parseFloat(String(vars["PurchasePrice"]))).toFixed(5);
    vars["NewCLTVValue(Expected)"] = (parseFloat(String(vars["NewCLTVValue"])) * parseFloat(String("100"))).toFixed(3);
  } else {
    vars["TotalLoanAmount"] = (parseFloat(String(vars["LoanAmount"])) + parseFloat(String(vars["SecondLoanAmount"]))).toFixed(0);
    vars["NewCLTVValue"] = (parseFloat(String(vars["TotalLoanAmount"])) / parseFloat(String(vars["AppraisedValue"]))).toFixed(5);
    vars["NewCLTVValue(Expected)"] = (parseFloat(String(vars["NewCLTVValue"])) * parseFloat(String("100"))).toFixed(3);
  }
}

