/**
 * Step Group: Verifying Price Change and Added Concession in Loan Scenario Page
 * ID: 2337
 * Steps: 16
 */
export async function stepGroup_Verifying_Price_Change_and_Added_Concession_in_Loan_Scenario(page: import('@playwright/test').Page, vars: Record<string, string>) {
  await page.locator("//h6[text()=\"Pricing Adjustment\"]").scrollIntoViewIfNeeded();
  await expect(page.locator("(//table[@id=\"pricing-table\"]/tbody/tr/td/div[contains(normalize-space(), \"$|PriceValue|\") ])[last()]")).toBeVisible();
  vars["TotalPricingAdjustment"] = await page.locator("//table[@id='pricing-table']/tfoot/tr/td[last()]/div").textContent() || '';
  vars["BasePrice"] = await page.locator("//table//tr[th[normalize-space()='Price']]/td[count(//table//th[normalize-space()='Base']/preceding-sibling::th)]").textContent() || '';
  vars["AdjPriceValue"] = await page.locator("//table//tr[th[normalize-space()='Price']]/td[count(//table//th[normalize-space()='Adj.']/preceding-sibling::th)]").textContent() || '';
  expect(String(vars["AdjPriceValue"])).toBe(vars["TotalPricingAdjustment"]);
  vars["NewNetPriceValue"] = (parseFloat(String(vars["BasePrice"])) - parseFloat(String(vars["AdjPriceValue"]))).toFixed(3);
  vars["NetPrice"] = await page.locator("//table//tr[th[normalize-space()='Price']]/td[count(//table//th[normalize-space()='Net']/preceding-sibling::th)]").textContent() || '';
  vars["FinalPrice"] = await page.locator("//table//tr[th[normalize-space()='Price']]/td[count(//table//th[normalize-space()='Final']/preceding-sibling::th)]").textContent() || '';
  expect(String(vars["NetPrice"])).toBe(vars["NewNetPriceValue"]);
  expect(String(vars["FinalPrice"])).toBe(vars["NewNetPriceValue"]);
  await page.locator("//h6[text()[normalize-space() = \"Loan Scenario\"]]").scrollIntoViewIfNeeded();
  vars["UpdatedPriceData"] = await page.locator("(//span[text()=\"Price\"]/following::div)[1]").textContent() || '';
  expect(String(vars["UpdatedPriceData"])).toBe(vars["FinalPrice"]);
  expect(String(vars["UpdatedPriceData"])).toBe(vars["PriceBeforeFloatingConcession"]);
}

